import Login from '../pages/Login'
import Center from '../pages/Center'
import Photos from '../pages/Phot'
export default[
    {
        path:'/',
        redirect:'/login'
    },
    {
        path: '/login',
        component: Login
    },
    {
        path:'/center',
        component:Center
    },
    {
        path:'photos',
        component:Photos
    }
]
